using System.Collections;
using System.Collections.Generic;
using UnityEngine;
using UnityEngine.Networking;
using System;
using System.Text.RegularExpressions;

[Serializable]
public class InputData
{
    public string prompt;
    public string image;
    public double prompt_strength = 0.7;
    public int num_outputs = 1;
    public int num_inference_steps = 30;
    public double guidance_scale = 7.5;
    public string scheduler = "DPMSolverMultistep";
}

public class ImageRetriever : MonoBehaviour
{
    private string imageURI = "data:image/png;base64,";
    private string finalImageURL;
    public SpriteRenderer spriteRender;
    public string input;
    //private void Start()
    //{
      //  Prompt("Crazy Neon Man");
    //}
    public void Prompt()
    {
        InputData inputData = new InputData();
        inputData.image = imageURI;
        inputData.prompt = input;
        var inputJson = JsonUtility.ToJson(inputData);
        string json = "{\"version\":\"15a3689ee13b0d2616e98820eca31d4c3abcd36672df6afce5cb6feb1d66087d\",\"input\":"+inputJson+"}";
        Debug.Log(json);
        StartCoroutine(Post("https://api.replicate.com/v1/predictions", json));
    }
    IEnumerator Post(string url, string bodyJsonString)
    {
        var request = new UnityWebRequest(url, "POST");
        byte[] bodyRaw = System.Text.Encoding.UTF8.GetBytes(bodyJsonString);
        request.uploadHandler = (UploadHandler)new UploadHandlerRaw(bodyRaw);
        request.downloadHandler = (DownloadHandler)new DownloadHandlerBuffer();
        request.SetRequestHeader("Content-Type", "application/json");
        request.SetRequestHeader("Authorization", "Token ae5ed39cd46c8beffcf8933665dacb83b9153eee");
        yield return request.SendWebRequest();
        if (request.responseCode == 201)
        {
            string getURL = request.downloadHandler.text.Split('\"')[51];
            StartCoroutine(Get(getURL));
        }
    }

    IEnumerator Get(string getURL)
    {
        var getRequest = new UnityWebRequest(getURL, "GET");
        getRequest.SetRequestHeader("Authorization", "Token ae5ed39cd46c8beffcf8933665dacb83b9153eee");
        getRequest.downloadHandler = (DownloadHandler)new DownloadHandlerBuffer();
        yield return new WaitForSeconds(5f);
        yield return getRequest.SendWebRequest();
        if (getRequest.result == UnityWebRequest.Result.Success)
        {
            Debug.Log(getRequest.downloadHandler.text);
            var match = Regex.Match(getRequest.downloadHandler.text, "\"output\":\\[\"(.+)\"\\]");
            finalImageURL = match.Groups[1].Value;
            StartCoroutine(GetTexture());
        }
        else
        {
            Debug.Log(getRequest.error);
        }
    }

    IEnumerator GetTexture()
    {
        UnityWebRequest www = UnityWebRequestTexture.GetTexture(finalImageURL);
        yield return www.SendWebRequest();

        if (www.result != UnityWebRequest.Result.Success)
        {
            Debug.Log(www.error);
        }
        else
        {
            Texture2D myTexture = ((DownloadHandlerTexture)www.downloadHandler).texture;
            spriteRender.sprite = Sprite.Create(myTexture, new Rect(0, 0, myTexture.width, myTexture.height), new Vector2(0.5f, 0.5f));
        }
    }
}
